import {FETCH_EARNINGS} from '../actions/actionCreator';

let initialState = [];

let Earnings = (state = initialState, action) =>{
    if(action.type === FETCH_EARNINGS){
        return{
            ...state,
            activities: action.payLoad,
        }
    }

    return state;
}

export default Earnings;
